import React from "react";
import { Grid } from "@material-ui/core";

const Arrow = ({ direction, handleClick }: any) => (
  <>
    {direction === "right" ? (
      <>
        <Grid contsiner style={{ height: "0px" }} xs={12}>
          <Grid
            style={{
              height: "600px",
              backgroundColor: "#00ccff",
              position: "absolute",
              top: "0em",
            }}
            xs={2}
          >
            {" "}
          </Grid>{" "}
        </Grid>{" "}
      </>
    ) : (
      <>
        <Grid contsiner style={{ height: "0px" }} xs={12}>
          <Grid style={{ height: "0px" }} xs={10}>
            {" "}
          </Grid>{" "}
          <Grid style={{ height: "0px" }} xs={2}>
            {" "}
          </Grid>{" "}
        </Grid>{" "}
      </>
    )}
  </>
);

export default Arrow;
